import React, { useState, useEffect } from "react";
import Itinerary from "./Itinerary";

const App = () => {
  const [items, setItems] = useState([]); // Always initialize with an empty array

  useEffect(() => {
    fetch("/api/itinerary") // Update API URL if needed
      .then((res) => res.json())
      .then((data) => setItems(data || [])) // Ensure data is an array
      .catch((error) => console.error("Error fetching itinerary:", error));
  }, []);

  return (
    <div>
      <h1>My Travel Itinerary</h1>
      <Itinerary items={items} />
    </div>
  );
};

export default App;
